import axios from "axios";
import React, { useState } from "react";
import { useParams } from "react-router-dom";

const Oyuncular =() =>{

    const [oyuncular, setOyuncular]=useState([])

    const api_link=`https://cryptic-gorge-72989.herokuapp.com/players`
    axios.get(api_link)
    .then(oyuncular=>{
        setOyuncular(oyuncular.data)
    },[])


    return(
        <div>
           {
            oyuncular.map(oyun=>
                <div>
                    <p>{oyun.name}</p>
                </div>
                )
           }
        </div>
    )
}

export default Oyuncular;
